Aloe is a stemless succulent plant with thick and fleshy leaves with serrated margins. While it grows wild in several tropical climates, it also<strong>grows indoor successfully as a potted plant.</strong>It is relatively<strong>resistant to most insect pests</strong>.Which again means you dont have to spend your time swatting away those pests from leaves and have a ready remedy at hand for those cuts, bruises and skin ailments!

